import React, { Fragment, Component } from 'react';
import PropTypes from "prop-types";
import { EuiLoadingSpinner } from '../../loading';
import { EuiFormControlLayoutClearButton } from './form_control_layout_clear_button';
import { EuiFormControlLayoutCustomIcon } from './form_control_layout_custom_icon';
export var ICON_SIDES = ['left', 'right'];

function isIconShape(icon) {
  return !!icon && icon.hasOwnProperty('type');
}

export class EuiFormControlLayoutIcons extends Component {
  render() {
    const {
      icon
    } = this.props;
    const iconSide = isIconShape(icon) && icon.side ? icon.side : 'left';
    const customIcon = this.renderCustomIcon();
    const loadingSpinner = this.renderLoadingSpinner();
    const clearButton = this.renderClearButton();
    let leftIcons;

    if (customIcon && iconSide === 'left') {
      leftIcons = <div className="euiFormControlLayoutIcons">{customIcon}</div>;
    }

    let rightIcons; // If the icon is on the right, it should be placed after the clear button in the DOM.

    if (clearButton || loadingSpinner || customIcon && iconSide === 'right') {
      rightIcons = <div className="euiFormControlLayoutIcons euiFormControlLayoutIcons--right">
          {clearButton}
          {loadingSpinner}
          {iconSide === 'right' ? customIcon : undefined}
        </div>;
    }

    return <Fragment>
        {leftIcons}
        {rightIcons}
      </Fragment>;
  }

  renderCustomIcon() {
    const {
      icon
    } = this.props;

    if (!icon) {
      return null;
    } // Normalize the icon to an object if it's a string.


    const iconProps = isIconShape(icon) ? icon : {
      type: icon
    };
    const {
      ref: iconRef,
      side,
      ...iconRest
    } = iconProps;
    return <EuiFormControlLayoutCustomIcon iconRef={iconRef} {...iconRest} />;
  }

  renderLoadingSpinner() {
    const {
      isLoading
    } = this.props;

    if (!isLoading) {
      return null;
    }

    return <EuiLoadingSpinner size="m" />;
  }

  renderClearButton() {
    const {
      clear
    } = this.props;

    if (!clear) {
      return null;
    }

    return <EuiFormControlLayoutClearButton {...clear} />;
  }

